drop database if exists grupos_trabajo;
CREATE DATABASE  grupos_trabajo;
USE grupos_trabajo;

-- centros
DROP TABLE IF EXISTS `centro`;
CREATE TABLE `centro` (
  `codigo` char(8) CHECK (codigo REGEXP '^[0-9]{8}') NOT NULL,
  `denominacion` varchar(45)  NOT NULL,
  `nombre` varchar(30)  NOT NULL,
  `dependencia` enum('público','privado')  NOT NULL DEFAULT 'público',
  `domicilio` varchar(100)  DEFAULT NULL,
  `localidad` varchar(30)  DEFAULT NULL,
  `provincia` ENUM ('Almería', 'Cádiz', 'Córdoba', 'Granada','Huelva', 'Jaén', 'Málaga', 'Sevilla')   DEFAULT NULL,
  `cp` char(5) CHECK (cp REGEXP '^[0-9]{5}') DEFAULT NULL,
  `telefono` char(9) CHECK (telefono REGEXP '^[0-9]{9}') DEFAULT NULL,
  `bilingue` tinyint NOT NULL DEFAULT '0',
  
  PRIMARY KEY (`codigo`)
) ;
-- departamentos
DROP TABLE IF EXISTS `departamento`;
CREATE TABLE `departamento` (
  `codigo` tinyint NOT NULL,
  `nombre` varchar(35)  NOT NULL,
  `area` ENUM ('CT', 'AE', 'SL', 'OR')  DEFAULT 'CT',
  PRIMARY KEY (`codigo`)
);
DROP TABLE IF EXISTS `dep_centro`;
CREATE TABLE `dep_centro` (
  `cod_centro` char(8)  NOT NULL,
  `cod_dep` tinyint NOT NULL,
  `num_profesores` numeric(2,0) check (num_profesores >= 0)  DEFAULT '0',
  PRIMARY KEY (`cod_centro`,`cod_dep`),
  KEY `fk_dep_centro_2_idx` (`cod_dep`),
  CONSTRAINT `fk_dep_centro_1` FOREIGN KEY (`cod_centro`) REFERENCES `centro` (`codigo`),
  CONSTRAINT `fk_dep_centro_2` FOREIGN KEY (`cod_dep`) REFERENCES `departamento` (`codigo`)
);
-- profesores
DROP TABLE IF EXISTS `profesor`;
CREATE TABLE `profesor` (
  `cod_profesor` char(6)  check (cod_profesor REGEXP '^[A-Z]{2}[0-9]{3}') NOT NULL,
  `nombre` varchar(25)  NOT NULL,
  `apellido1` varchar(25)  NOT NULL,
  `apellido2` varchar(25)  NOT NULL,
  `sexo` enum('H','M')  DEFAULT NULL,
  `localidad` varchar(30)  DEFAULT NULL,
  `provincia` ENUM ('Almería', 'Cádiz', 'Córdoba', 'Granada','Huelva', 'Jaén', 'Málaga', 'Sevilla')  DEFAULT NULL,
  `dni` char(9)  NOT NULL,
  `telefono` char(9) CHECK (telefono REGEXP '^[0-9]{9}')  DEFAULT NULL,
  `cod_centro` char(8) NULL,
  `cod_dep` tinyint NULL,
  PRIMARY KEY (`cod_profesor`),
  UNIQUE KEY `dni_UNIQUE` (`dni`),
  KEY `fk_profesor_1_idx` (`cod_centro`,`cod_dep`),
  CONSTRAINT `fk_profesor_1` FOREIGN KEY (`cod_centro`, `cod_dep`) REFERENCES `dep_centro` (`cod_centro`, `cod_dep`)
) ;
-- GT
/* se modifica para que el coordinador sea uno de los integrantes del grupo de trabajo*/
/* se da la posibilidad de que sea NULL, cuando se crea el grupo de trabajo*/
DROP TABLE IF EXISTS `grupotrabajo`;
CREATE TABLE `grupotrabajo` (
  `cod_gt` char(8) check (cod_gt REGEXP '^GT[0-9]{6}') NOT NULL,
  `nombre` varchar(45)  NOT NULL,
  `fec_inicio` date NOT NULL,
  `fec_fin` date NOT NULL,
  `num_profesores` numeric(2,0) check (num_profesores >= 0) DEFAULT '0',
  `cod_coordinador` char(6)  NULL,
  PRIMARY KEY (`cod_gt`),
  KEY `grupotrabajo_ibfk_1` (`cod_coordinador`),
  CONSTRAINT `grupotrabajo_ibfk_1` FOREIGN KEY (`cod_coordinador`) REFERENCES `profesor` (`cod_profesor`)
);
-- componentes GT
DROP TABLE IF EXISTS `componentes_gt`;
CREATE TABLE `componentes_gt` (
  `cod_gt` char(8)  NOT NULL,
  `cod_profesor` char(6)  NOT NULL,
  PRIMARY KEY (`cod_gt`,`cod_profesor`),
  KEY `cod_profesor` (`cod_profesor`),
  CONSTRAINT `componentes_gt_ibfk_1` FOREIGN KEY (`cod_gt`) REFERENCES `grupotrabajo` (`cod_gt`),
  CONSTRAINT `componentes_gt_ibfk_2` FOREIGN KEY (`cod_profesor`) REFERENCES `profesor` (`cod_profesor`)
);
